#define CONV2D_3_BIAS_LSHIFT   (MAX_POOLING2D_2_OUTPUT_SHIFT+CONV2D_3_KERNEL_0_SHIFT-CONV2D_3_BIAS_0_SHIFT)
#if CONV2D_3_OUTPUT_RSHIFT < 0
#error CONV2D_3_OUTPUT_RSHIFT must be bigger than 0
#endif
