#endif
#define CONV2D_4_OUTPUT_RSHIFT (DROPOUT_1_OUTPUT_SHIFT+CONV2D_4_KERNEL_0_SHIFT-CONV2D_4_OUTPUT_SHIFT)
#define CONV2D_4_BIAS_LSHIFT   (DROPOUT_1_OUTPUT_SHIFT+CONV2D_4_KERNEL_0_SHIFT-CONV2D_4_BIAS_0_SHIFT)
